INSERT INTO `ruangan` (`id_ruangan`, `nama_ruangan`, `lokasi`, `deskripsi_fasilitas`) VALUES
('R001', 'LOKER', 'Lantai 1', 'Ruangan Loker merupakan fasilitas pendukung bagi pengunjung dalam menyediakan tempat penyimpanan yang aman bagi pemustaka untuk menyimpan barang atau peralatan (tas, buku, jaket dll) yang tidak diperkenan dibawah ke dalam perpustakaan. Pada ruangan ini terjdapat 50 lemari penyimpanan barang yang dapat digunakan oleh pengunjung untuk menyimpan barang barangnya.'),
('R002', 'CREATIVE CO-WORKING SPACE', 'Lantai 1', 'Ruangan creative co-working space adalah ruangan dimana para pengunjung dapat melaksanakan kegiatan produktivitas seperti belajar, meeting, dll. Pada ruangan ini terdapat banyak meja dan kursi serta dilengkapi AC untuk membuat para pengunjung lebih nyaman dan produktif.'),
('R003', 'CAFETARIA', 'Lantai 1', 'Ruangan Cafetaria adalah ruangan disediakan oleh perpustakaan sebagai salah satu fasilitas pendukung perpustakaan untuk memenuhi kebutuhan akan nutrisi pengguna dikarenakan lokasi kantin sangat jauh. Pada ruangan ini terdapat berbagai macam stand penjual makanan dan minuman yang pengunjung dapat beli produknya serta pada ruangan ini terdapat meja dan kursi untuk memfasilitasi pengunjung yang ingin menyantap makanan pada ruangan ini.'),
('R004', 'DIVISI PENGOLAHAN', 'Lantai 1', 'Ruangan divisi pengolahan merupakan tempat pengolahan koleksi yang ada di perpustakaan ITS. Kegiatan mengelola koleksi yang dimiliki oleh perpustakaan hingga penyajian koleksi kepada pemustaka yang didukung dengan sistem informasi yang terintegrasi.'),
('R005', 'DIVISI PENGADAAN', 'Lantai 1', 'Ruangan divisi pengadaan merupakan ruangan tempat pengadaan koleksi yang ada di perpustakaan iTS. Ruangan ini merupakan ruangan tempat proses awal dari seluruh kegiatan perpustakaan. Divisi ini melakukan proses seleksi, menghimpun, mengelola, menentukan dan mengadakan koleksi yang relevan dengan kebutuhan pemustaka.'),
('R006', 'RUANGAN SEMINAR', 'Lantai 2', 'Ruang Seminar adalah sebuah ruang yang bisa dimanfaatkan untuk kegiatan seminar , training, workshop, rekrutment pegawai dan lain-lain oleh internal maupun eksternal ITS. Ruang ini memiliki daya tampung sebanyak 120 meja kursi, difasilitasi dengan sound sistem, wireless, AC, dan tarif sewa yang relatif murah.'),
('R007', 'RUANG RAPAT BIBLIOTEK', 'Lantai 2', 'Ruang Rapat Bibliotek merukapan ruangan rapat utama perpustakaan dengan desain meja melingkar. Dilengkapi sarana seperti, AC, dispenser, mikrofon dan LCD proyektor sebagai media komunikasi rapat dan penyampaian materi.'),
('R008', 'RUANG BELAJAR PAPYRUS', 'Lantai 2', 'Ruang belajar Papyrus merupakan ruang dengan desain ruang kelas berkapasitas 40 meja kursi  biasa digunakan untuk ruang kuliah, diklat, seminar , test kerja, dll.'),
('R009', 'AREA BELAJAR', 'Lantai 2', 'Area belajar yang  luas dan tenang di lantai dua ini merupakan tempat belajar alternatif yang dapat digunakan oleh pemustaka. Selain itu area ini tidak berada di dalam ruang koleksi sehingga pemustaka bebas membawa tas, makan dan minuman di area ini.'),
('R010', 'MUSHOLA', 'Lantai 2', 'Perpustakaan menyediakan tempat berdoa/sholat bagi para pemustaka untuk memudahkan pemustaka melakukan ibadah tanpa harus keluar perpustakaan dan mereka bisa melanjutkan belajarnya dengan tenang.'),
('R011', 'SAMPOERNA CORNER', 'Lantai 3', 'Ruangan Sampoerna Corner dilengkapi dengan koleksi buku mengenai pengembangan diri atau soft skill(motivasi, kewirausahaan, bahasa, manajemen, dsb), DVD para pionir bangsa beserta DVD player, televisi berwarna dan 6 (enam) unit perangkat komputer untuk mengakses Internet. Sampoerna Corner juga menawarkan berbagai kegiatan seperti diskusi interaktif, seminar, serta workshop yang diselenggarakan dan diikuti oleh civitas akademika ITS maupun masyarakat umum. Jumlah koleksi buku cetak di Sampoerna Corner yang tersedia sebanayak 1227 judul/ eksemplar.'),
('R012', 'IDIS ITS', 'Lantai 3', 'Sebuah ruang untuk sentra layanan informasi pembangunan Indonesia yang dibentuk melalui kemitraan antara ITS dengan dengan Bank Dunia (World Bank). Ruang IDIS-WB dilengkapi koleksi VCD/DVD serta buku-buku terbitan Bank Dunia dengan konten proyek dan laporan proyek World Bank di seluruh dunia. Koleksi tersebut umumnya berkaitan dengan perkembangan pembangunan dunia dan khususnya di negara-negara yang sedang berkembang, seperti: perkembangan ekonomi, sosial, budaya, lingkungan, teknologi, kesehatan, dll. Ruang IDIS-WB dilengkapi 7 buah komputer untuk akses internet, televisi layar datar, DVD player, dan sofa yang nyaman. Jumlah koleksi World Bank yang tersedia sebanyak 534 Judul ; 616 eksemplar.'),
('R013', 'CAFE HOTSPOT', 'Lantai 3', 'Ruang baca ini didesain menyerupai cafe. Cafe sangat identik dengan suasana tenang dan santai. Konsep tersebut sangat cocok untuk selera anak muda saat ini, dimana mereka memiliki kepuasan tersendiri bila mendapatkan tempat belajar ala cafe di perpustakaan. Ketenangan dan kenyamanan sebuah tempat belajar bagi pemustaka adalah sarana penting bagi mereka karena suasana akan sangat berpengaruh pada hasil akhir belajar mereka.'),
('R014', 'RUANGAN MAJALAH', 'Lantai 3', 'Perpustakaan menyediakan koleksi terbitan berkala berupa majalah/jurnal ilmiah dalam bahasa Indonesia maupun bahasa Inggris tercetak. Koleksi tersebut diperoleh melalui pembelian dan hadiah. Di samping itu, disediakan juga majalah ilmiah populer yang berkaitan dengan arsitektur, pertanian, hobi, dan intisari. Untuk memenuhi kebutuhan informasi yang bersifat rekreatif, disediakan tabloid olahraga, otomotif, komputer, agrobisnis dan lainnya. Majalah/jurnal ilmiah ini dapat dipinjam untuk dibaca di tempat, difotokopi dan dibawa pulang. Lama peminjaman koleksi majalah ini adalah 3 jam. Layanan Majalah ini berada di Lantai 3, Perpustakaan ITS. Jumlah koleksi yang dimiliki perpustakaan sebanyak 2.207 judul, 62.892 eksemplar untuk jurnal/majalah dan 6 judul untuk surat kabar.'),
('R015', 'RUANGAN REFERENSI', 'Lantai 3', 'Layanan Referensi menawarkan berbagai macam koleksi rujukan, seperti handbook, manual book, guide book, standard, kamus, ensiklopedia, dan lainnya. Pemustaka dapat meminjam koleksi dengan batas maksimal 3 judul buku selama 3 jam'),
('R016', 'RUANGAN KOMPUTER', 'Lantai 3', 'Ruangan ini merupakan sebuah ruangan yang memiliki fasilitas komputer dan juga terdapat LCD proyektor sebagai media komunikasi rapat dan penyampaian materi.'),
('R017', 'RUAGAN MULTIMEDIA', 'Lantai 4', 'Ruangan multimedia adalah ruangan tempat koleksi berbentuk non buku seperti: CD/VCD, video cassette, video film, microform (microfilm, microfische), slide, transparansi dan lainnya. Layanan audio visual tidak meminjamkan koleksinya untuk dibawa pulang, namun hanya untuk dibaca di tempat. Pada ruang audio visual disediakan juga Home Theater untuk program pemutaran film gratis yang diadakan setiap dua kali seminggu, yakni hari Selasa dan Kamis.'),
('R018', 'IKOMA CORNER', 'Lantai 4', 'Koleksi yang ada di Ruang IKOMA Corner adalah koleksi informasi muatan lokal (local content information), yaitu produk karya ilmiah yang dihasilkan civitas akademika ITS. Karya ini meliputi karya mengenai ITS, karya yang ditulis civitas akademika ITS, serta karya yang berkaitan dengan temuan, paten dan sebagainya yang dihasilkan civitas akademika ITS. Informasi muatan lokal ini secara garis besar dikelompokkan kedalam dua kelompok besar, yaitu: Tugas Akhir dan Karya ITS. Yang mana Tugas Akhir terdiri dari Skripsi, Tesis, Desertasi, Pendidikan Profesi dan Kerja Praktek (KP).'),
('R019', 'RUANGAN KOLEKSI UMUM', 'Lantai 5', 'Koleksi buku di lantai 5 adalah koleksi yang terdiri dari buku teks wajib, buku teks penunjang dan buku teks anjuran yang relevan dengan kurikulum yang berlaku di ITS. buku tersebut berisi informasi dari berbagai disiplin ilmu yang tersebar pada rak dengan nomor klasifikasi 000-900. Jumlah koleksi buku teks yang dimiliki perpustakaan sebanyak 41.649 Judul ; 98.209 eksemplar. Sirkulasi juga memberikan layanan bebas pustaka bagi mahasiswa sebagai bukti bahwa dia tidak mempunyai pinjaman atau kewajiban lain kepada perpustakaan. Pemberian bebas pustaka dimaksudkan agar koleksi terpelihara dan mahasiswa mematuhi peraturan perpustakaan. Bagi mahasiswa, bebas pustaka diperlukan untuk yudisium atau pengambilan ijazah. Ruang layanan sirkulasi juga menyediakan komputer untuk mencetak ( print) tanpa dipungut biaya dengan membawa kertas sendiri'),
('R020', 'PLN CORNER', 'Lantai 5', 'Ruangan ini memiliki fasilitas seperti tempat diskusi dimana terdapat meja dan kursi yang disusun secara melingkar untuk melakukan diskusi. Pada ruangan ini juga terdapat LCD dan monitor untuk membantu pada pengguna ruangan dalam mekukan meeting dan penyampaian materi.');
